import {heroes} from './bases/data/heroes';
console.log(heroes)

const getHeroesById=(id)=>heroes.find(e=>e.id===id)
const hero1=getHeroesById(1);
console.log(hero1);

const getHeroByOwner=(owner)=>heroes.find(e=>e.owner===owner)
